	F_Informa varchar(10000),
	F_DepartmentId varchar(10),
	U_ErrorCode varchar(20),
	U_PageStatus varchar(10),
	U_PageNum varchar(10),
	U_PageCode varchar(10),
	U_ErrorMemo varchar(100),
	F_Remark varchar(100),
	FCreateUserId uuid,
	FCreateDepartmentId uuid,
	FCreateTime timestamp,
	FUpdateUserId uuid,
	FUpdateDepartmentId uuid,
	FUpdateTime timestamp,
	F_IDNumber varchar(15),
	F_Satisfy varchar(20),
	U_CaseType varchar(10)
);

create table Tpm12111 (FEntityId uuid, FValue varchar(100));
create index Ipm121111 on Tpm12111 (FEntityId);
create index Ipm121112 on Tpm12111 (FEntityId, FValue);



